import { useNavigate } from "react-router-dom";
import "./piratesCreatePage.css";
import { useState } from "react";
import axios from "axios";

const PiratesCreatePage = () => {
  const [name, setName] = useState("");
  const [image, setImage] = useState("");
  const [treasure, setTreasure] = useState("0");
  const [phrase, setPhrase] = useState("");
  const [legs, setLegs] = useState(false);
  const [eyes, setEyes] = useState(false);
  const [hand, setHand] = useState(false);
  const [select, setSelect] = useState("Captain");

  const navigate = useNavigate();

  // metodo para crear pirata
  const createPirate = async () => {
    if (
      name === "" ||
      image === "" ||
      treasure === "" ||
      phrase === "" ||
      select === ""
    ) {
      alert("Complete los datos del Pirata");
      return;
    }
    let pirateObjData = {
      namePirate: name,
      imageUrl: image,
      numberTreasure: treasure,
      crewPosition: select,
      stickLegs: legs,
      eyePatch: eyes,
      handHook: hand,
      pirateCatchPhrase: phrase,
    };
    try {
      let responseCreate = await axios.post(
        "http://localhost:8110/api/pirate/create",
        pirateObjData
      );
      if (responseCreate.status === 200) {
        const createPirateId = responseCreate.data._id;
        navigate("/pirates/detailPirate/" + createPirateId);
        setName("");
        setImage("");
        setTreasure("");
        setPhrase("");
        setLegs(false);
        setEyes(false);
        setHand(false);
        setSelect("Captain");
      }
    } catch (e) {
      console.log(e.response.data.message);
      alert(e.response.data.message);
    }
  };

  const crewBoard = () => {
    navigate("/pirates");
  };

  return (
    <div>
      <div className="headerCreate">
        <h1>Add Pirate</h1>
        <button onClick={crewBoard}>Crew Board</button>
      </div>
      <div className="containerPirate">
        <div className="formleft">
          <label>Pirate Name:</label>
          <br />
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
          <br />
          <label>Image URL:</label>
          <br />
          <input
            type="text"
            value={image}
            onChange={(e) => setImage(e.target.value)}
          />
          <br />
          <label># Treasure chests:</label>
          <br />
          <input
            className="inputreasure"
            type="number"
            value={treasure}
            onChange={(e) => setTreasure(e.target.value)}
          />
          <br />
          <label>Pirate Catch Phrase:</label>
          <br />
          <input
            className="inputphrase"
            type="text"
            value={phrase}
            onChange={(e) => setPhrase(e.target.value)}
          />
          <br />
        </div>
        <div className="formrigth">
          <label>Crew Position:</label>
          <br />
          <select
            className="selectpirate"
            value={select}
            onChange={(e) => setSelect(e.target.value)}
          >
            <option className="optionpirate">Captain</option>
            <option className="optionpirate">First Mate</option>
            <option className="optionpirate">Quarter Master</option>
            <option className="optionpirate">Boatswain</option>
            <option className="optionpirate">Powder Monkey</option>
          </select>
          <br />
          <div className="inputs">
            <div className="inputatribute">
              <input
                type="checkbox"
                value={legs}
                onChange={(e) => setLegs(e.target.checked)}
              />
              <label>Stick Legs</label>
            </div>
            <br />
            <div className="inputatribute">
              <input
                className="check"
                type="checkbox"
                value={eyes}
                onChange={(e) => setEyes(e.target.checked)}
              />
              <label>Eye Patch</label>
            </div>
            <br />
            <div className="inputatribute">
              <input
                type="checkbox"
                value={hand}
                onChange={(e) => setHand(e.target.checked)}
              />
              <label>Hand Hook</label>
            </div>
            <br />
            <button onClick={createPirate}>Add Pirate</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PiratesCreatePage;
